// components/Admin.js
import React from "react";
import Sidebar from "./SideBar";
//import DashboardContent from "./DashBoardContent";
import { Route, Switch } from "react-router-dom/cjs/react-router-dom.min";
//import Navbar from "../Components/Navbar/Navbar";\
import "../App/App.css";
import UserManage from "./UserManage";

import DashboardContent from "./DashBoardContent";
import EditUserPage from "./EditUser";
import UpdateProfilePage from "./UpdateProfile";

const Admin = () => {
  return (
    <div className="app-container">
      <Sidebar />
      <Switch>
        <div className="content-container">
          <Route path="/admin/user" component={UserManage} />
          <Route path="/admin/edit" component={DashboardContent} />
          <Route path="/admin" component={DashboardContent} exact />
          <Route path="/admin/user/edit" component={UpdateProfilePage} />
        </div>
      </Switch>
    </div>
  );
};

export default Admin;
